import React, { Component, useState, useEffect } from 'react'
import { BrowserRouter as BrowserRouter, Routes, Route } from 'react-router-dom'
import Navbar from "./components/navbar";

const App = () => {
  return (
    <BrowserRouter>
      <Routes>
        <Route exact path="/" element={<Navbar />}>
          <Navbar />
        </Route>
      </Routes>
    </BrowserRouter>
  )
}

export default App
